import '../../styles/admin.css';
import { Button } from 'react-bootstrap';
import React, { useState, useEffect} from "react";
import { checkDatabaseConnection } from "../../http/checkBaseConnectionAPI";

const RosAvtoDor = () => {
  const [databaseStatus, setDatabaseStatus] = useState("");

  useEffect(() => {
    const checkConnectionStatus = async () => {
      try {
        const isConnected = await checkDatabaseConnection();
        setDatabaseStatus(isConnected ? "В сети" : "Нет подключения");
      } catch (error) {
        console.error("Ошибка при проверке подключения к базе данных:", error);
        setDatabaseStatus("Ошибка");
      }
    };
    checkConnectionStatus();

    const data = [
      { registry: "Реестр 1", table: "Таблица 1", lastUpdated: "2023-06-17", number: 1 },
      { registry: "Реестр 2", table: "Таблица 2", lastUpdated: "2023-06-16", number: 2 },
      { registry: "Реестр 3", table: "Таблица 3", lastUpdated: "2023-06-15", number: 3 },
      { registry: "Реестр 3", table: "Таблица 3", lastUpdated: "2023-06-15", number: 3 },
    ];
    return () => {
      setDatabaseStatus("");
    };
  }, []);
    return (
      <div className="card">
      <div className="card-header">
        <h3>Информация об реестрах "РосАвтоДор"</h3>
      </div>
      <div className="card-body">
        <div className="card-field">
          <label>Статус:</label>
          <label>{databaseStatus}</label>
        </div>
        <div className="card-field">
          <label>Дата обновления:</label>
          <label>Дата обновления:</label>
        </div>
        <div className="card-field">
          <label>Ответственный:</label>
          <label>Токмачева Ольга Николаевна</label>
        </div>
        <div className="card-field">
          <label>Телефон:</label>
          <label>+ 7 (499) 550-34-36 доб. 1041</label>
        </div>
        <div className="card-field">
          <label>Почта:</label>
          <label>o.tokmacheva@roszeldor.ru</label>
        </div>
      </div>
      <div className="card-footer">
        <Button variant="primary">Проверить наличие обновлений</Button>
        <Button variant="primary">Обновить данные БД</Button>
        <Button variant="primary">Обновить структуру БД</Button>
      </div>
      <Table striped bordered hover>
      <thead>
        <tr>
          <th>#</th>
          <th>Реестр</th>
          <th>Таблица</th>
          <th>Последнее обновление</th>
        </tr>
      </thead>
      <tbody>
        {data.map((item) => (
          <tr key={item.number}>
            <td>{item.number}</td>
            <td>{item.registry}</td>
            <td>{item.table}</td>
            <td>{item.lastUpdated}</td>
          </tr>
        ))}
      </tbody>
    </Table>
    </div>
  );
};
  export default RosAvtoDor;
